void Set_Index(unsigned char index) {
  TFT_RS = 0;
  PMDOUT = index;
  while(PMMODE & 0x8000); //Busy bit
}

void Write_Command(unsigned char command ) {
  TFT_RS = 1;
  PMDOUT = command;
  while(PMMODE & 0x8000); //Busy bit
}

void Write_Data(unsigned int _data) {
  TFT_RS = 1;
  PMDOUT = _data;
  while(PMMODE & 0x8000); //Busy bit
}


void Write_Command_SSD1963(unsigned char Command) {
  TFT_RS = 0;  //RS = 0 NOT DATA  D/C = 0
  PMDOUT = Command;
  while(PMMODE & 0x8000); //Busy bit
}


void Write_Data_SSD1963(unsigned int _data) {
  TFT_RS = 1;   //RS = 1 = DATA   D/C = 1
  PMDOUT = _data;
  while(PMMODE & 0x8000); //Busy bit
}

void Init_16Bit_PMP() {                              // zero wait time is 8 ns strobe @224MHz   1=18.5ns  2=28ns
                                                    //  5=55ns @224MHz and sram corrupt   3=36.5 to 37ns =2.240 MHz   4 = 46ns
  PMMODE = 0;
  PMCONBits.DUALBUF = 1;  //DUAL BUFFER FOR IN AND OUT
  PMMODEbits.MODE = 2;    //Master 2     Slave =1
  PMMODEbits.WAITB = 0;   //WAITB<1:0>: Data Setup before a Read/Write Strobe Wait States bits(1) 11 = Data wait of 4 TPB; multiplexed address phase of 4 TPB  10 = Data wait of 3 TPB; multiplexed address phase of 3 TPB 01 = Data wait of 2 TPB; multiplexed address phase of 2 TPB 00 = Data wait of 1 TPB; multiplexed address phase of 1 TPB (default)
  PMMODEbits.WAITM = 1;   //1111 = Wait of 16 TPB --0001 = Wait of 2 TPB-- 0000 = Wait of 1 TPB (default)STROBE PULSE WIDTH
  PMMODEbits.WAITE = 0;   //bit 1-0WAITE<1:0>: Data Hold After Read/Write Strobe Wait States bits(1)

  PMMODEbits.MODE16 = 1;  // 1 = 16-bit mode: a read or write to the data register invokes a single 16-bit transfer   For read operations  11 = Wait of 3 TPB  00 = Wait of 0 TPB (default)
  PMCONbits.CSF = 0;      //chip select bit
  PMCONbits.PTRDEN = 1;   //READ STROBE
  PMCONbits.PTWREN = 1;   //WRITE STROBE
  PMCONbits.PMPEN = 1;    //PMP ENABLE
  TFT_Set_Active(Set_Index,Write_Command,Write_Data);
}

void TFT_Set_DBC_SSD1963_BACKLIGHT(unsigned char value) {  //PAGE54
  TFT_CS = 0;
  Write_Command_SSD1963(0xBE);
  Write_Data_SSD1963(0x06);
  Write_Data_SSD1963(value);
  Write_Data_SSD1963(0x01); // PWM CONTROLLED BY DBC
  Write_Data_SSD1963(0xFF); //MAX
  Write_Data_SSD1963(0x00); //MIN
  Write_Data_SSD1963(0x01);
  TFT_CS = 1;
}



void TFT_SET_MODE_SSD1963_5_Inch(){  // & newer 7"            Page 84 for timing


      TFT_CS_Direction = 0;
      TFT_RST_Direction = 0;
      TFT_RD_Direction = 0;
      TFT_WR_Direction = 0;
      TFT_RST = 0;
      Delay_ms(10);
      TFT_RST = 1;
      Delay_ms(10);
      TFT_RD = 1;
      TFT_WR = 1;

      TFT_CS = 0;

      Write_Command_SSD1963(0x01);   //Software Reset
      Delay_ms(10);                  //The Host Processor Must Wait 5ms Before Sending Any New Commands


      Write_Command_SSD1963(0xE2);   // SET PLL
      Write_Data_SSD1963(32);        // MULTIPLIER 10 MHz BASE CLOCK x
      Write_Data_SSD1963(2);         // DIVIDES BY THIS NUMBER + 1 DIVIDE BY 3 = 100 MHz
      Write_Data_SSD1963(0x54);      // DUMMY

      Write_Command_SSD1963(0xE0);
      Write_Data_SSD1963(0x01);      // START PLL   BIT ZERO
      Delay_ms(70);                  // Wait 100us for the PLL to Lock 08/07/21
      Write_Command_SSD1963(0xE0);
      Write_Data_SSD1963(0x03);      // BIT 1 = USE PLL AS OUTPUT BIT ZERO = ENABLE PLL 08/07/21

      Write_Command_SSD1963(0x26);   // Set Gamma Curve
      Write_Data_SSD1963(1);         // Gamma curve selection =0
      //Write_Data_SSD1963(2);       // Gamma curve selection =1
      //Write_Data_SSD1963(4);       // Gamma curve selection =2
      //Write_Data_SSD1963(8);       // Gamma curve selection =3

      Write_Command_SSD1963(0x0B);   //SET SCAN MODE    TFT_Set_Index_Ptr(0x0B);
      Write_Data_SSD1963(0);         //Top to bottom, left to right normal etc

      Write_Command_SSD1963(0x0A);
      Write_Data_SSD1963(0x1C);      //Power Mode

      Write_Command_SSD1963(0xF0);    //Set Pixel Data Interface D/C = 0
      Write_Data_SSD1963(3);          //16-bit (565 format)   011 16-bit (565 format) D/C = 1

      Write_Command_SSD1963(0x3A);       //Set Pixel Format
      Write_Data_SSD1963(0b01010000);   // bits 6,5,4  101 16-bit/pixel   111 24-bit/pixel

      Write_Command_SSD1963(0x38);     //Exit Idle Mode

      Write_Command_SSD1963(0x13);     //Enter Normal Mode;

     //Write_Command_SSD1963(0x34);    //0x34 Set_tear_off     PAGE 72 FOR TEAR
      Write_Command_SSD1963(0x35);     //0x 35 set_tear_on
      Write_Data_SSD1963(0b00000000); //PAGE 65  BIT ZERO = 1 FOR BOTH VERTICAL AND HORIZONTAL SYNC, 0 = VERTICAL SYNC ONLY

      Write_Command_SSD1963(0xB8);          //0xB8 set_gpio_conf
      Write_Command_SSD1963(0xBA);          //0xBA set_gpio_value Set GPIO value for GPIO configured as output

      Write_Command_SSD1963(0xBC);   //Set Post Proc
      Write_Data_SSD1963(65);        //40 Set the contrast value     4D == 77  127 decimal is max    4D FOR CHINA DISPLAY
      Write_Data_SSD1963(110);       //80 Set the brightness value   80 == 128 160 decimal is about max  85 FOR CHINA DISPLAY 08/07/21
      Write_Data_SSD1963(0x50);      //40 Set the saturation value   40 ==  64  127 decimal is max!  zero is black & white 6E FOR CHINA DISPLAY
      Write_Data_SSD1963(0x01);      //1 Enable the postprocessor

      Write_Command_SSD1963(0xB0);   //SET LCD MODE   SIZE !!  08/07/21
      Write_Data_SSD1963(32);        //Bit 5 Is 24 Bit Colour On TFT Panel All Active Low Pulses  MIDAS TFT PANEL IS 24 BIT
      Write_Data_SSD1963(0);         //BIT 6 & 5TFT MODE NOT SERIAL
      Write_Data_SSD1963(0x03);      //03 SET horizontal size=800+1 HightByte   !!!!!!!!!!!!
      Write_Data_SSD1963(0x1F);      //SET horizontal size=800+1 LowByte
      Write_Data_SSD1963(0x01);      //SET vertical size=480+1 HightByte
      Write_Data_SSD1963(0xE0);      //SET vertical size=480+1 LowByte
      Write_Data_SSD1963(0);         //Even line RGB sequence / Odd line RGB sequence RGB

      // Set LSHIFT freq (DCLK from PLL)
      //  Typical DCLK for TM070RBH10 is 29.23MHz  NEW ==  Dot Data ClockD CLK - 33.26 - MHz  for 5" <<<<<<<<<<
      // 33.30 = 120 * (LCDC_FPR + 1) / 2^20
      // 5.3 (million) times  2^20  divide  120 = 46312    // y over x   on calculator

      Write_Command_SSD1963(0xe6);   //Pixel Clock Frequency  08/07/21
      Write_Data_SSD1963(0x05);      //>>>LCD_FPR = 349550
      Write_Data_SSD1963(0x55);      //40,000,076 Hz   40 MHz  349 526    08/07/21
      Write_Data_SSD1963(0x6E);

      /////////////////////////HORIZONTAL PERIOD BELOW /////  08/07/21  ///////////////////////////////////////

      Write_Command_SSD1963(0xB4);   // Set Horizontal Period   MIN 862 TYPICAL 1056 MAX 1200
      Write_Data_SSD1963(0x03);      // High byte of horizontal total period (display + non-display)   900 = 0X384
      Write_Data_SSD1963(0x84);      // Low byte of the horizontal total period (display + non-display) 900
      Write_Data_SSD1963(0x00);      // High byte of the non-display period between the start of the horizontal sync (LLINE) signal and the first display data. TOO LOW CAPTURE WONT WORK
      Write_Data_SSD1963(92);        // 25 August 2021 MIN BLANKING SPEC IS 62 Low byte of the non-display period between the start of the horizontal sync (LLINE) signal and the first display data
      Write_Data_SSD1963(8);         // Set the vertical sync pulse width
      Write_Data_SSD1963(0x00);      // SET Hsync pulse start position
      Write_Data_SSD1963(0x00);
      Write_Data_SSD1963(0x00);      //SET Hsync pulse subpixel start position

      /////////////////////  08/07/21  //// VERTICAL PERIOD BELOW ////////////

      Write_Command_SSD1963(0xB6);       //Set Vertical Period Set Vertical Period MIN = 510 TYPICAL = 525 MAX = 650  08/07/21
      Write_Data_SSD1963(0x02);      // High byte of the vertical total (display + non-display) period in lines
      Write_Data_SSD1963(0x17);      // Low byte INCREASES SYNC TIME AND BACK PORCH  (530) 480 + 40 +  10
      Write_Data_SSD1963(0x00);      // 00
      Write_Data_SSD1963(49);        //The non-display period in lines between the start of the frame and the first display data in line.
      Write_Data_SSD1963(6);         //Set the vertical sync pulse width (LFRAME) in lines. TFT DOES NOT REQUIRE A SYNC PULSE
      Write_Data_SSD1963(0x00);      //SET Vsync pulse start position  08/07/21
      Write_Data_SSD1963(0x00);

      Write_Command_SSD1963(0x36);              //   Set Vertical Period
      Write_Data_SSD1963(0b00000000);           //   BIT 7 = 0 Top to bottom, pages transferred from SP (Start Page) to EP (End Page).
                                                //   BIT 6 0 Left to right, columns transferred from SC (Start Column) to EC (End Column).
                                                //   BIT 5 0 Normal mode
                                                //   BIT 4 0 LCD refresh from top line to bottom line.
                                                //   BIT 3 0 RGB
                                                //   BIT 2 0 LCD refresh from left side to right side
                                                //   BIT 1 0 Normal
                                                //   BIT 0 0 Normal

      Write_Command_SSD1963(0x29);             //    SET display on     ************
      TFT_CS = 1;
}

