  SPI3_Init_Advanced(_SPI_MASTER, _SPI_8_BIT, 10, _SPI_SS_DISABLE, _SPI_DATA_SAMPLE_Middle, _SPI_CLK_IDLE_HIGH, _SPI_ACTIVE_2_IDLE);


